import React from 'react';
import { Termekek } from './Termekek.js'; // Importálod a Termekek tömböt
import Termek from './Termek'; // Feltételezem, hogy a Termek komponens is ugyanabban a mappában van

const Etel = () => {
  return (
    <div>
      {Termekek.map(termek => <Termek key={termek.id} data={termek} />)}
    </div>
  );
};

export default Etel;
